import React from 'react';

const TodoItem = ({ todo, onDeleteTodo }) => {
	return (
		<li>
			{todo}

			<div className="icons">
				<input type="checkbox" />
				<label>
					<span className="custom-checkbox" />
				</label>

				<i className="fas fa-trash" style={{ cursor: 'pointer' }} onClick={onDeleteTodo} />
			</div>
		</li>
	);
};

export default TodoItem;
